const maxCartLen = 7;
const myCart = Array(maxCartLen).fill(0);

// ===========================
// PDF GENERATION
// ===========================
function generateInvoicePDF(doprint) {
    const doc = new jsPDF();
    const imgData = 'data:image/jpeg;base64,';
    doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);
    doc.setFontSize(10);
    doc.setFontType("bold");

    const fx = document.forms["myForm"];
    const fx2 = document.forms["myForm2"];
    const optionstxt = { maxWidth: "125" };
    const centerText = { align: "center", maxWidth: "45" };

    // --- Invoice Header Data ---
    doc.text(String(fx["invn"].value), 42, 62);
    doc.text(formatDate(fx["invd"].value), 42, 66.3);
    doc.text(fx["trans"].value, 42, 70.6);
    doc.text(fx["vehnum"].value, 42, 74.9);
    doc.text([fx["billto"].value], 74, 66.3, optionstxt);

    // --- Items ---
    let amtfinal = 0, totquant = 0, sno = 0;
    for (let i = 0; i < maxCartLen; i++) {
        if (!myCart[i]) continue;
        const itemY = 112 + sno * 13;

        const q = parseFloat(fx2["quan" + (i + 1)].value) || 0;
        const rate = parseFloat(fx2["Rate" + (i + 1)].value) || 0;
        const amtcur = q * rate;

        writeItemLine(doc, fx2, i + 1, sno + 1, itemY, centerText, amtcur);

        amtfinal += amtcur;
        totquant += q;
        sno++;
    }

    doc.text(String(amtfinal.toFixed(2)), 187, 199.3, centerText)
    // --- Tax Calculation ---
    const charges = getAdditionalCharges(fx, amtfinal);
    const gross = (charges.total - charges.advance).toFixed(2);

    writeSummary(doc, charges, totquant, gross, centerText, fx);

    if (doprint)
        doc.save(`INVOICE_${fx["invn"].value}.pdf`);
    else
        showAlertSummary(amtfinal, charges, gross);
}

function formatDate(d) {
    const dt = new Date(d);
    return `${dt.getDate()}/${dt.getMonth() + 1}/${dt.getFullYear()}`;
}

function writeItemLine(doc, fx2, idx, sno, y, options, amtcur) {
    const fields = ["itemname", "hsn", "gsm", "size", "quan", "bund", "Rate"];
    const positions = [44, 75.5, 90.7, 109.2, 131.1, 147, 164.5];

    doc.text(`${sno}.`, 15, y, options);

    fields.forEach((field, i) => {
        doc.text(String(fx2[field + idx].value), positions[i], y, options);
    });

    doc.text(amtcur.toFixed(2), 187, y, options);
}

function getAdditionalCharges(fx, baseAmount) {
     const out = parseFloat(fx["carrout"].value) || 0;
        const other = parseFloat(fx["otherchg"].value) || 0;
        const adv = parseFloat(fx["lessadv"].value) || 0;

        let total = baseAmount;

        const igstRate = parseFloat(fx["igstval"].value) || 0;
        const cgstRate = parseFloat(fx["cgstval"].value) || 0;
        const sgstRate = parseFloat(fx["sgstval"].value) || 0;

        const igst = fx["igstq"].checked ? total * igstRate / 100 : 0;
        const cgst = fx["cgstq"].checked ? total * cgstRate / 100 : 0;
        const sgst = fx["sgstq"].checked ? total * sgstRate / 100 : 0;

        total += igst + cgst + sgst + out + other;
        total = parseFloat(Math.round(total)).toFixed(2);

        return {
            igst, cgst, sgst,
            igstRate, cgstRate, sgstRate,
            out, other,
            advance: adv,
            total: parseFloat(total)
        };
}

function writeSummary(doc, c, totalQty, gross, options, fx) {
    doc.text(totalQty.toFixed(3), 131.1, 208, options);

    // Just print percentages next to the existing labels
    if (fx["cgstq"].checked) {
        doc.text(`${c.cgstRate}%`, 164, 214.5, options);   // CGST
    }
    if (fx["sgstq"].checked) {
        doc.text(`${c.sgstRate}%`, 164, 208, options);     // SGST
    }
    if (fx["igstq"].checked) {
        doc.text(`${c.igstRate}%`, 163, 221, options);   // IGST
    }




    // Values next to %
    doc.text(c.sgst.toFixed(2), 187, 208, options);
    doc.text(c.cgst.toFixed(2), 187, 214.5, options);
    doc.text(c.igst.toFixed(2), 187, 221, options);

    // Other charges
    doc.text(c.out.toFixed(2), 187, 228, options);
    doc.text(c.other.toFixed(2), 187, 236.5, options);
    doc.text(c.total.toFixed(2), 187, 245, options);
    doc.text(c.advance.toFixed(2), 187, 253.5, options);

    // Final
    doc.setFontType("bold");
    doc.text(gross, 187, 263, options);
}

function showAlertSummary(base, c, gross) {
    alert(
        `\n----------------------------` +
        `\nITEM COST: ${base.toFixed(2)}` +
        `\nEXTRA COST: ${(c.out + c.other).toFixed(2)}` +
        `\nTAX: ${(c.igst + c.cgst + c.sgst).toFixed(2)} (IGST ${c.igstRate}%, CGST ${c.cgstRate}%, SGST ${c.sgstRate}%)` +
        `\nADV PROVIDED: ${c.advance.toFixed(2)}` +
        `\n----------------------------` +
        `\nFINAL AMOUNT: ${gross}` +
        `\n----------------------------`
    );
}

// ===========================
// FORM VALIDATION
// ===========================
function validateForm(doprint) {
    const fx = document.forms["myForm"];
    const fx2 = document.forms["myForm2"];

    const requiredFields = [
        { name: "invn", label: "invoice number" },
        { name: "invd", label: "invoice date" },
        { name: "billto", label: "Consignee Details" }
    ];

    for (const field of requiredFields) {
        if (fx[field.name].value === "") {
            alert(`Enter ${field.label}`);
            return false;
        }
    }

    let hasItem = false;
    for (let i = 0; i < maxCartLen; i++) {
        if (!myCart[i]) continue;
        hasItem = true;
        const q = fx2["quan" + (i + 1)].value;
        const r = fx2["Rate" + (i + 1)].value;
        const n = fx2["itemname" + (i + 1)].value;
        if (q === "" || r === "" || n === "") {
            alert(`Enter item ${i + 1} details or REMOVE item ${i + 1}`);
            return false;
        }
    }

    if (!hasItem) {
        alert("NO ITEMS ADDED. PLEASE ADD ITEM.");
        return false;
    }

    generateInvoicePDF(doprint);
    return true;
}

function validateFormUtil() {
    if (validateForm(false) !== false) {
        generateInvoicePDF(false);
    }
}

// ===========================
// ITEM MANAGEMENT
// ===========================
function checkAvailInCart() {
    for (let i = 0; i < maxCartLen; i++) {
        if (!myCart[i]) {
            myCart[i] = 1;
            return i + 1;
        }
    }
    return -1;
}

function addElement(parentId, elementTag, elementId, html) {
    const p = document.getElementById(parentId);
    const newElement = document.createElement(elementTag);
    newElement.innerHTML = html;
    newElement.id = elementId;
    newElement.classList.add("itembox");
    p.appendChild(newElement);
}

function removeItem(ele1, ele2, eid) {
    myCart[eid - 1] = 0;
    document.getElementById(ele1)?.remove();
    document.getElementById(ele2)?.remove();
    return false;
}

function addItem() {
    const itemid = checkAvailInCart();
    if (itemid === -1) {
        alert("CART FULL");
        return;
    }

    const html = `
        <fieldset class="card2 itemfieldset" style="margin-bottom: 10px;">
            <legend>ITEM <span style="font-size:25px;font-weight:bold;">[${itemid}]</span> DETAILS</legend>
            PRODUCT DESC.:<br>
            <input type="text" name="itemname${itemid}" list="itemname${itemid}" size="40">
            <datalist id="itemname${itemid}">
                <option>Snacks Carry Bag with Print</option>
                <option>YPL Kraft Grossing Carry bag</option>
                <option>YPL Kraft Paper Carry bag with Handle</option>
                <option>YPL Kraft Paper Carry bag with Handle & Printing</option>
                <option>MG Kraft Paper Carry bag with Handle</option>
                <option>MG Kraft Paper Carry bag with Handle & Printing</option>
            </datalist><br>
            GSM: <br><input type="number" step="0.01" name="gsm${itemid}"><br>
            HSN CODE: <br><input type="number" step="1" name="hsn${itemid}"><br>
            SIZE: <br><input type="text" name="size${itemid}"><br>
            QUANTITY (KG/PIECES): <br><input type="number" step="0.01" name="quan${itemid}"><br>
            BUNDLES: <br><input type="number" step="1" name="bund${itemid}"><br>
            RATE (KG/PIECES): <br><input type="number" step="0.01" name="Rate${itemid}"><br>
        </fieldset><br>`;

    const btnhtml = `
        <button style="background-color:#e60000;padding: 10px;" onclick="removeItem('itembox${itemid}','removebtn${itemid}',${itemid});">
            <span style="color: white">REMOVE ITEM #${itemid}</span>
        </button>`;

    addElement('items', 'div', 'itembox' + itemid, html);
    addElement('itembuttons', 'div', 'removebtn' + itemid, btnhtml);
}